INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (1, 0, 1, "カリン", "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1, 0, "", 1, 190804, 60000, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (2, 1, 1, "", "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 2, 0, "", 0, 0, 60000, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (3, 1, 1, "", "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 2, 0, "", 0, 0, 60000, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (4, 1, 2, "", "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 2, 0, "", 0, 0, 60000, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (5, 2, 1, "", "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 2, 0, "", 0, 0, 60000, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (6, 2, 1, "", "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 2, 0, "", 0, 0, 60000, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (7, 2, 2, "", "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 2, 0, "", 0, 0, 60000, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (8, 3, 1, "", "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 2, 0, "", 0, 0, 60000, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (9, 3, 1, "", "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 2, 0, "", 0, 0, 60000, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (10, 3, 1, "", "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 2, 0, "", 0, 0, 60000, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (11, 3, 1, "", "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 2, 0, "", 0, 0, 60000, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (12, 3, 2, "", "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 2, 0, "", 0, 0, 60000, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (13, 4, 1, "", "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 2, 0, "", 0, 0, 60000, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (14, 4, 1, "", "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 2, 0, "", 0, 0, 60000, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (15, 4, 1, "", "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 2, 0, "", 0, 0, 60000, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (16, 4, 1, "", "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 2, 0, "", 0, 0, 60000, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (17, 4, 2, "", "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 2, 0, "", 0, 0, 60000, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (18, 0, 0, "カリン", "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 3, 0, "", 2, 190804, 60000, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (19, 0, 0, "カリン", "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 3, 7, "", 3, 190804, 60000, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (20, 0, 0, "ハツネ", "キミと出会ってもう\n1年もたつんだね！\nう～ん、いつも\n寝てばっかりだから、", 0, 1, "", 1, 101201, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (21, 0, 0, "ハツネ", "少しでも\n寝る時間を減らして\nキミと一緒にいる\n時間増やしたいなぁ♪", 0, 1, "", 2, 101201, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (22, 0, 0, "シオリ", "あなたと知り合ってから\nもう1年…\n時がたつのは\n早いですね", 1, 1, "", 1, 103801, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (23, 0, 0, "シオリ", "来年も、\n一緒にいられたら…\nうれしいな", 1, 1, "", 2, 103801, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (24, 0, 0, "キョウカ", "あなたと一緒にいるようになって、\nもう1年ですか…", 0, 2, "", 1, 103601, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (25, 0, 0, "キョウカ", "最初の頃よりも、頼もしく\nなりましたね。私はどうですか？\n成長していますか？", 0, 2, "", 2, 103601, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (26, 0, 0, "ミミ", "おにいちゃんとあってから、\n1年たったよ～！", 1, 2, "", 1, 102001, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (27, 0, 0, "ミミ", "ミミね、おにいちゃんと\nいっぱい遊べてたのしかったな～♪\nこれからもずっと\nいっしょにいてね～！", 1, 2, "", 2, 102001, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (28, 0, 0, "ミソギ", "にいちゃんがミソギのイタズラに\n引っかかり続けてもう1年かぁ", 2, 2, "", 1, 100401, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (29, 0, 0, "ミソギ", "…これからもいっぱいミソギと\n遊んでね、にいちゃん！", 2, 2, "", 2, 100401, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (30, 0, 0, "マホ", "もう王子はんと会うてから\n1年ぐらいたつそうどすえ\n早いもんやなあ", 0, 3, "", 1, 101001, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (31, 0, 0, "マホ", "このままやと、\nうちもあっという間に\n干からびてしまいそうどすえ\nなーんてな。うふふ", 0, 3, "", 2, 101001, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (32, 0, 0, "イリヤ", "お主と会って早1年じゃな\nこれからも存分に尽くすがよい", 1, 3, "", 1, 104401, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (33, 0, 0, "イリヤ", "わらわもたまには、お主の献身に\n報いてやらぬでもない♪", 1, 3, "", 2, 104401, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (34, 0, 0, "カオリ", "もう、キミと出会って結構な時間が\nたつさ～。でも、私たちの旅は\nまだまだ始まったばかりさ～！", 2, 3, "", 1, 101701, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (35, 0, 0, "カオリ", "これからも、どうぞよろしく\nお願いするさ～！", 2, 3, "", 2, 101701, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (36, 0, 0, "サレン", "あんたと出会ってからもうそんなに\nたつのね～", 0, 4, "", 1, 102801, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (37, 0, 0, "サレン", "あっという間だったって感じるほど\n楽しかったわ！\nこれからも一緒に頑張りましょ！", 0, 4, "", 2, 102801, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (38, 0, 0, "スズメ", "出会ってから1年間、ずっと\nご迷惑をかけっぱなしで、\nすみません…", 1, 4, "", 1, 102501, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (39, 0, 0, "スズメ", "これからはもっと頑張りますから\n見ていてくださいね\nできれば…\n今までよりも、私の近くで♪", 1, 4, "", 2, 102501, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (40, 0, 0, "タマキ", "振り返れば、今までいろんなことが\nあったにゃあ…", 0, 5, "", 1, 104601, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (41, 0, 0, "タマキ", "これからも、二人でたくさんの\n思い出をがっぽり作っていく\nにゃー！", 0, 5, "", 2, 104601, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (42, 0, 0, "ミフユ", "キミとの師弟関係も、\nもう1年なのね…\nでもキミに教えることは、", 1, 5, "", 1, 104801, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (43, 0, 0, "ミフユ", "まだまだいっぱいあるわ\nこれからも、\nしっかりついて来てね！", 1, 5, "", 2, 104801, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (44, 0, 0, "アキノ", "あなたさまと出会ってもう1年…", 0, 6, "", 1, 103201, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (45, 0, 0, "アキノ", "光陰矢のごとし、とはまさに\nこのことですわ。…思い出は決して\nお金では買えませんわね", 0, 6, "", 2, 103201, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (46, 0, 0, "ユカリ", "ダメな私を1年間も見捨てないで\nくれて、本当にありがとう", 1, 6, "", 1, 103401, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (47, 0, 0, "ユカリ", "情けないところいっぱいみせるかも\nしれないけど、これからも一緒に\nいてくれると、うれしいな", 1, 6, "", 2, 103401, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (48, 0, 0, "クリスティーナ", "オマエと出会ってもう1年か\nまさかこのワタシの結婚相手に\nなろうとはな…", 0, 7, "", 1, 107101, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (49, 0, 0, "クリスティーナ", "ともかくこれからも\n愉しませてくれよ☆", 0, 7, "", 2, 107101, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (50, 0, 0, "ジュン", "君と出会ってからもう1年か。\n以前と比べて私の表情もいくらか\n柔らかくなった気がするんだが、\nどうだろう？", 1, 7, "", 1, 104701, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (51, 0, 0, "ジュン", "見えないから分からないって？\nそれもそうだな…", 1, 7, "", 2, 104701, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (52, 0, 0, "トモ", "もう1年たったみたいだね\nあなたをからかってばかりだった\nけど、楽しかった♪", 0, 8, "", 1, 103701, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (53, 0, 0, "トモ", "これからもよろしくね！", 0, 8, "", 2, 103701, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (54, 0, 0, "マツリ", "出会って、もう1年たっちゃった\nんスね。なんだか意外ッス", 1, 8, "", 1, 100501, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (55, 0, 0, "マツリ", "毎日楽しくて、あっという間に過ぎ\nちゃったみたいなんスよね\nこれからも一緒に悪と戦うッス！", 1, 8, "", 2, 100501, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (56, 0, 0, "ミヤコ", "オマエと会って1年なの！\n全然成仏もできなかったし、", 0, 9, "", 1, 100701, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (57, 0, 0, "ミヤコ", "生き返りもしなかったけど、\nすごく楽しかったの～♪\nオマエとプリンがあれば、\nミヤコはハッピーなの～♪", 0, 9, "", 2, 100701, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (58, 0, 0, "シノブ", "あなたと出会って1年なんですね\nでも、私の占いでは、私とあなたは", 1, 9, "", 1, 103101, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (59, 0, 0, "シノブ", "来年も再来年も一緒にいるようです\nふふ、よろしくお願いしますね", 1, 9, "", 2, 103101, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (60, 0, 0, "アンナ", "貴様が閃光のシグルドとして覚醒し\nもう1年か…。これからも我らの\n長き戦いに終わりはないが、", 0, 10, "", 1, 100901, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (61, 0, 0, "アンナ", "それでも貴様となら…\n添い遂げる覚悟はできているぞ！", 0, 10, "", 2, 100901, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (62, 0, 0, "ナナカ", "君と出会ってもう1年だって！\n早いねー！", 1, 10, "", 1, 101301, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (63, 0, 0, "ナナカ", "これからも最強のバディタッグで\n大活躍だー！\n頼りにしてるよ、相棒！", 1, 10, "", 2, 101301, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (64, 0, 0, "ミツキ", "1年たつのって、あっという間ね\nまだまだ君の知らない部分が\nたくさんあるし…", 0, 11, "", 1, 105101, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (65, 0, 0, "ミツキ", "これからも、いろんなところを\n調べさせてね？", 0, 11, "", 2, 105101, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (66, 0, 0, "ルカ", "お前さんと出会ってもう1年か\n助太刀するつもりが", 1, 11, "", 1, 105601, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (67, 0, 0, "ルカ", "逆に助けられたりもしたね\nこれからもよろしく頼むよ！", 1, 11, "", 2, 105601, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (68, 0, 0, "エリコ", "早いものですわね、あなた様と\nお会いして、もう1年…", 2, 11, "", 1, 102701, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (69, 0, 0, "エリコ", "あなた様といると、時があっと\nいう間に過ぎてしまいます\n時間を止める研究をしなくては\nいけませんね…", 2, 11, "", 2, 102701, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (70, 0, 0, "アヤネ", "お兄ちゃんと会ってから、もう、\n1年なんだね。私、少しは\nお姉ちゃんっぽくなったかな？", 0, 12, "", 1, 102301, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (71, 0, 0, "アヤネ", "あ、ぷうきちもお兄ちゃんっぽく\nなったよね？", 0, 12, "", 2, 102301, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (72, 0, 0, "チカ", "あなたと出会って、\nもう1年がたったんですね…\nこれからもそばにいて、", 1, 12, "", 1, 104201, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (73, 0, 0, "チカ", "私のことを見守ってください\nできることなら、ずっと…", 1, 12, "", 2, 104201, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (74, 0, 0, "クルミ", "お兄ちゃんと出会って1年かぁ\n私、相変わらずダメダメで…", 2, 12, "", 1, 102101, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (75, 0, 0, "クルミ", "で、でもこれからもずっと…\n一緒にいたいなぁ…", 2, 12, "", 2, 102101, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (76, 0, 0, "シズル", "再会してちょうど1年だね\nお祝いにごちそう作ってきたよ～♪\n特製ケーキと、お寿司と、", 0, 13, "", 1, 104901, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (77, 0, 0, "シズル", "ハンバーグと、カレーと、\nシチューと、あ、隠しきれない隠し\n味は、お姉ちゃんの愛情だよ！", 0, 13, "", 2, 104901, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (78, 0, 0, "リノ", "お兄ちゃんと再会して、もう1年\nなんですね。\n会えなかった時を思うと、", 1, 13, "", 1, 101101, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (79, 0, 0, "リノ", "信じられないくらい幸せな1年\nでした！もう絶対、私から離れ\nないでくださいね♪", 1, 13, "", 2, 101101, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (80, 0, 0, "ユイ", "騎士クンと出会ってから今まで、\nいろんなことがあったよね\n楽しいこと、ドキドキしたこと…", 0, 14, "", 1, 100201, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (81, 0, 0, "ユイ", "そんな日々をこれからも、\nず、ずっと一緒に…\n過ごしていきたいな…！", 0, 14, "", 2, 100201, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (82, 0, 0, "ヒヨリ", "騎士くんと出会って、まだ1年しか\nたってないんだ！？", 1, 14, "", 1, 100101, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (83, 0, 0, "ヒヨリ", "なんかもうずっと一緒にいる気が\nするなぁ…えへへ。これからの\n1年もまたよろしくねっ！\n騎士くん！", 1, 14, "", 2, 100101, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (84, 0, 0, "レイ", "初めてキミに出会って1年…\n随分見違えたね私もキミも、\n更に強くなっていく…", 2, 14, "", 1, 100301, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (85, 0, 0, "レイ", "キミに背中を預けられる日が、\n早くきますように", 2, 14, "", 2, 100301, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (86, 0, 0, "ペコリーヌ", "1年もわたしのことを、忘れない\nでいてくれて、ありがとうござい\nます！", 0, 15, "", 1, 105801, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (87, 0, 0, "ペコリーヌ", "これからもずっと、覚えていて\nくださいね！", 0, 15, "", 2, 105801, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (88, 0, 0, "コッコロ", "こうして1年も、主さまのおそばに\n置いていただけて、とても光栄\nです。どうかこれからも、", 1, 15, "", 1, 105901, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (89, 0, 0, "コッコロ", "末永く主さまをお世話させて\nください。わたくしは、ずっと\n主さまのガイド役でいたいのです", 1, 15, "", 2, 105901, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (90, 0, 0, "キャル", "1年か、まっさかこんなに長い\n付き合いになるなんてね～\nでも…わりと楽しい1年だったかも", 2, 15, "", 1, 106001, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (91, 0, 0, "キャル", "だから、もうしばらくあんたに\n付き合ってやるわよ喜びなさい！", 2, 15, "", 2, 106001, 80001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (92, 0, 1, "スズメ", "新しい年のはじめに、\nおみくじはいかがでしょうか？\nよい運勢であるほど、\n沢山プレゼントが貰えますよ♪", 1, 0, "", 1, 112101, 60001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (93, 1, 1, "", "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 2, 0, "", 0, 0, 60001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (94, 1, 1, "", "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 2, 0, "", 0, 0, 60001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (95, 1, 1, "", "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 2, 0, "", 0, 0, 60001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (96, 1, 1, "", "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 2, 0, "", 0, 0, 60001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (97, 1, 2, "", "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 2, 0, "", 0, 0, 60001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (98, 2, 1, "", "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 2, 0, "", 0, 0, 60001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (99, 2, 1, "", "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 2, 0, "", 0, 0, 60001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (100, 2, 1, "", "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 2, 0, "", 0, 0, 60001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (101, 2, 1, "", "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 2, 0, "", 0, 0, 60001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (102, 2, 2, "", "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 2, 0, "", 0, 0, 60001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (103, 3, 1, "", "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 2, 0, "", 0, 0, 60001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (104, 3, 1, "", "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 2, 0, "", 0, 0, 60001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (105, 3, 1, "", "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 2, 0, "", 0, 0, 60001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (106, 3, 1, "", "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 2, 0, "", 0, 0, 60001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (107, 3, 1, "", "今日の運勢は中吉！　お出かけした先で良縁に恵まれそうです！　ダウナー系あざとい女子が、あま～い飴をくれるかも？", 2, 0, "", 0, 0, 60001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (108, 3, 1, "", "今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", 2, 0, "", 0, 0, 60001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (109, 3, 2, "", "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 2, 0, "", 0, 0, 60001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (110, 4, 1, "", "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 2, 0, "", 0, 0, 60001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (111, 4, 1, "", "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 2, 0, "", 0, 0, 60001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (112, 4, 1, "", "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 2, 0, "", 0, 0, 60001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (113, 4, 1, "", "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 2, 0, "", 0, 0, 60001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (114, 4, 1, "", "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 2, 0, "", 0, 0, 60001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (115, 4, 1, "", "今日の運勢は小吉！　思わぬ相手と仲良くなれるかも？　　　　　うっかり毒舌をもらしてしまわないように要注意です！", 2, 0, "", 0, 0, 60001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (116, 4, 2, "", "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 2, 0, "", 0, 0, 60001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (117, 0, 0, "スズメ", "おみくじの結果はいかがでしたか？\n新たに始まる一日が、\nあなたにとってよい日になりますように\n明日もお待ちしていますね♪", 3, 0, "", 2, 112101, 60001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (118, 0, 0, "スズメ", "おみくじ、楽しんで頂けましたか？\nあなたの新しい年が\n素晴らしいものになるよう、\n心からお祈りしますね", 3, 7, "", 3, 112101, 60001, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (119, 0, 0, "ペコリーヌ", "ヒューヒュー♪\nドンドンパフパフー♪", 0, 1, "", 1, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (120, 0, 0, "コッコロ", "ひゅーひゅー\nどんどんぱふぱふー\nでございます", 1, 1, "", 1, 105901, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (121, 0, 0, "コッコロ", "さぁ、キャルさまもご一緒に\nどんどんぱふぱふいたしましょう", 1, 1, "", 2, 105901, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (122, 0, 0, "キャル", "え？　ちょっと\nいきなりなにっ？", 2, 1, "", 1, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (123, 0, 0, "キャル", "ドンドンパフパフってなんなの？\nあたしにも分かるように\nちゃんと説明しなさいっての！", 2, 1, "", 2, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (124, 0, 0, "ペコリーヌ", "実はですねキャルちゃん！\nもうすぐわたしたちにとっての\n大切な節目──", 0, 1, "", 2, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (125, 0, 0, "ペコリーヌ", "『プリンセスコネクト！\nRe:Dive』\n2.5周年なんですよ！\nやばいですね☆", 0, 1, "", 3, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (126, 0, 0, "コッコロ", "ですからその日に向けて\n今から気分を盛り上げているのです", 1, 1, "", 3, 105901, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (127, 0, 0, "キャル", "ああ、そういえば\nそんな時期だっけ\nって言っても、もう少し先じゃない\n気が早いんじゃないの？", 2, 1, "", 3, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (128, 0, 0, "コッコロ", "いいえ、キャルさま\nこういったお祝いは準備から\n楽しむものでございます\nそうですよね、ペコリーヌさま", 1, 1, "", 4, 105901, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (129, 0, 0, "ペコリーヌ", "その通りです♪　というわけで！\nカウントダウンの始まりですよ！\nみんなで一緒に2.5周年に向けて\n盛り上がっていきましょー☆", 0, 1, "", 4, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (130, 0, 0, "キャル", "ド、ドンドンパフパフ～\nって何言わせんのよ！\nまったくもう、浮かれちゃってさ", 2, 1, "", 4, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (131, 0, 0, "コッコロ", "ふふ。キャルさまもワクワクして\nおいでのようですね\nそれでは主さま。大切な記念日まで\nどうぞご期待くださいませ", 1, 1, "", 5, 105901, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (132, 0, 0, "キャル", "記念日を盛り上げるったって\n一体どうしたらいいのよ？\nあたし、そういうの\n苦手なんだけど…", 0, 2, "", 5, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (133, 0, 0, "カリン", "あら、キャルさん\nどうかなさいましたか？\n何かお困りのようですけど", 1, 2, "", 1, 190801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (134, 0, 0, "キャル", "げっ…カリンじゃない\nなんでもないわよ！", 0, 2, "", 6, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (135, 0, 0, "カリン", "そうなのですか？\nキャルさんのことですからてっきり\n2.5周年をどう盛り上げたら\nいいか悩んでいるのかと…", 1, 2, "", 2, 190801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (136, 0, 0, "キャル", "分かってんじゃないのよ！？\nいっ、いや、違うけどね！\nあたしは別にそんなことで\n悩んでないわよっ？", 0, 2, "", 7, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (137, 0, 0, "カリン", "ふふっ…\nこういう時は、真心を込めて\n気持ちをそのまま口にしたら\nいいのではないでしょうか？", 1, 2, "", 3, 190801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (138, 0, 0, "キャル", "気持ちを、ねぇ\nそれが一番難しいんじゃない…\nそもそも、あたしは記念日とか\n別にどうだっていいし", 0, 2, "", 8, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (139, 0, 0, "キャル", "…まあ、ペコリーヌもコロ助も\nやけに楽しそうだったから…\nこういうお祭り騒ぎみたいなのも\nたまにはいいかな、とは思うけど", 0, 2, "", 9, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (140, 0, 0, "カリン", "なるほどなるほど～\nキャルさんは【美食殿】で祝う\n2.5周年を心から楽しみに\nしている、ということですね！", 1, 2, "", 4, 190801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (141, 0, 0, "キャル", "はぁ！？\nどこ聞いたらそうなるのよ！\nあたしは別に楽しみになんか…！", 0, 2, "", 10, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (142, 0, 0, "カリン", "キャルさんの心からの想い\nみなさんにも伝わったでしょうか？\n私も2.5周年が楽しみです！\n以上、カリンがお伝えしました！", 1, 2, "", 5, 190801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (143, 0, 0, "キャル", "心からの想いって何なのよ！？\n勝手に人の言葉を\n捻じ曲げんじゃないわよ！\nこのくそ眼鏡ーーーっ！", 0, 2, "", 11, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (144, 0, 0, "コッコロ", "ペコリーヌさま、もうすぐ\n記念日でございますね\nこういった節目というのは\n感慨深いものでございます", 0, 3, "", 6, 105901, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (145, 0, 0, "ペコリーヌ", "色んな思い出が蘇ってきますね！\n楽しい出来事が\nいっぱいありました♪", 1, 3, "", 5, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (146, 0, 0, "コッコロ", "はい、そうでございますね\n主さまも【美食殿】の活動の他にも\nいろんなご経験をされたと\n聞いておりますよ", 0, 3, "", 7, 105901, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (147, 0, 0, "コッコロ", "たしか…ランドソルで話題沸騰と\nなっていた、魔法少女なるものに\nお会いになられたとか", 0, 3, "", 8, 105901, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (148, 0, 0, "ペコリーヌ", "魔法少女って、あの美味しくって\n栄養たっぷりの大ヒット商品\n『魔法少女ソーセージ』の箱に\n描いてある女の子のことですか！？", 1, 3, "", 6, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (149, 0, 0, "ペコリーヌ", "あのソーセージ\n美味しいんですよね～♪\nわたしもたっくさん食べてますよ！", 1, 3, "", 7, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (150, 0, 0, "コッコロ", "あとは、牧場に素敵な温泉が\n出来たとか…", 0, 3, "", 9, 105901, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (151, 0, 0, "ペコリーヌ", "牧場ですか！？　温泉につかって\nチーズもオツですね～♪　考えた\nだけでよだれが出ちゃいそうです！\nやばいですね☆", 1, 3, "", 8, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (152, 0, 0, "コッコロ", "ペコリーヌさま\n言ってるそばからよだれが…\n今お拭きしますね。ふき、ふき", 0, 3, "", 10, 105901, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (153, 0, 0, "ペコリーヌ", "えへへ、ありがとうございます\nコッコロちゃん！", 1, 3, "", 9, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (154, 0, 0, "コッコロ", "それにしても、主さまは\n【美食殿】の一員として様々な\n美食と出会われていたのですね\nわたくし、感服いたしました", 0, 3, "", 11, 105901, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (155, 0, 0, "ペコリーヌ", "これからもたくさん冒険をして\nめいっぱい美食を\n味わい尽くしましょうね！", 1, 3, "", 10, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (156, 0, 0, "ペコリーヌ", "2.5周年カウントダウン♪\nキャルちゃんキャルちゃん！\nわくわくしますね☆", 0, 4, "", 11, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (157, 0, 0, "キャル", "あぁもう、うるさいわね～\nまだまだ先でしょ？\nちょっとは落ち着きなさいよ", 1, 4, "", 12, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (158, 0, 0, "ペコリーヌ", "キャルちゃんだって最近\nソワソワしてるじゃないですか～\nさっきもご機嫌そうに鼻歌とか\n歌ってましたよね？", 0, 4, "", 12, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (159, 0, 0, "キャル", "なっ…！　き、聞いてたの！？\nじゃない、歌ってないわよ！？\nあんたいい加減なこと言うと\nぶっ殺すわよ！？", 1, 4, "", 13, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (160, 0, 0, "ペコリーヌ", "えっへへ～♪\nわたしは最近のキャルちゃんが\nもっともっと大好きですよ♪\nすごく積極的になりましたよね！", 0, 4, "", 13, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (161, 0, 0, "キャル", "…積極的？\nなんの話よ？", 1, 4, "", 14, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (162, 0, 0, "ペコリーヌ", "またまた～♪\nアイドルを目指そうとしたこと\n忘れちゃったんですか？", 0, 4, "", 14, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (163, 0, 0, "ペコリーヌ", "ムーサの町で\nきゃるきゃる～ん☆　って！", 0, 4, "", 15, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (164, 0, 0, "キャル", "あっ…！？　ちちち違うわよっ！\nあれは操られてただけで\nあたしはアイドルなんか\n目指してないっての！！", 1, 4, "", 15, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (165, 0, 0, "ペコリーヌ", "本当に本当ですか？\nわたし、キャルちゃんとっても\n乗り気だなって\n思ってたんですけど～", 0, 4, "", 16, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (166, 0, 0, "キャル", "まぁ、悪くはなかったけど…って\nだ、だから目指してないって\n言ってるでしょ！！\nなんてこと思い出させんのよ！？", 1, 4, "", 16, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (167, 0, 0, "キャル", "ああ…ダメだわ…\nもう殺すしかない…\n2.5周年が来る前に\n記憶ごと消し去ってやるー！", 1, 4, "", 17, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (168, 0, 0, "キャル", "2.5周年まであと10日…\nふ～ん？\n案外早いもんね？", 0, 5, "", 18, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (169, 0, 0, "コッコロ", "そうでございますね…\nその日のためにやるべきことは\nまだまだございます\n気を引き締めねばなりません…！", 1, 5, "", 12, 105901, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (170, 0, 0, "キャル", "やる気十分ねコロ助…\nそんな気負ってるとしんどいわよ？\nお気楽にやりましょ？", 0, 5, "", 19, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (171, 0, 0, "コッコロ", "キャルさま…\nありがとうございます\nキャルさまは本当に\n優しいおかたです", 1, 5, "", 13, 105901, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (172, 0, 0, "キャル", "な、なにわけの分かんないこと\n言ってんのよ…\nあたしは優しくなんかないっての", 0, 5, "", 20, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (173, 0, 0, "コッコロ", "そんなことはございません\n…あの、実はわたくし\nキャルさまに\nひとつお願いがございまして", 1, 5, "", 14, 105901, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (174, 0, 0, "キャル", "お願い？　珍しいわね\nコロ助がそんなこと言うなんて\n…まあ、あたしに出来ることなら\n別にいいけど", 0, 5, "", 21, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (175, 0, 0, "コッコロ", "ありがとうございます\n実は記念日へ向けて\n『かくし芸』というものを\n用意してみようかと思いまして", 1, 5, "", 15, 105901, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (176, 0, 0, "キャル", "かくし芸？", 0, 5, "", 22, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (177, 0, 0, "コッコロ", "はい。きゃるきゃる～ん☆　を\n参考に、ころころ～ん☆　という\nご挨拶を考えてみたのですが\nポーズがうまくいかなくて…", 1, 5, "", 16, 105901, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (178, 0, 0, "キャル", "～～！！　ちょっと褒められて\nいい気になって損したわ！！\nふざけんなふざけんな\nふ～ざ～け～ん～な～っ！！", 0, 5, "", 23, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (179, 0, 0, "ペコリーヌ", "あと９日！　もうすぐですよ♪\nえへへ、楽しみで楽しみで\nごはんが進みますね☆", 0, 6, "", 17, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (180, 0, 0, "キャル", "ごはんが進みますね☆\nじゃなーい！\nいくらなんでも食べ過ぎよ！\n記念日、迎えられなくなるわよ！？", 2, 6, "", 24, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (181, 0, 0, "コッコロ", "大丈夫ですよキャルさま\n食事はわたくしたちの\n歩んできた道そのもの\nなのですから", 1, 6, "", 17, 105901, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (182, 0, 0, "ペコリーヌ", "さっすがコッコロちゃん\nいいことを言いますね！\nそう、わたしたち\n【美食殿】の活動目的は─", 0, 6, "", 18, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (183, 0, 0, "キャル", "─みんなで楽しく食事をすること\nでしょ？\nあれだけ食べ歩いてきたんだから\n分かってるわよ", 2, 6, "", 25, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (184, 0, 0, "コッコロ", "はい…そうでございますね♪\nそれにしてもわたくしたち\n本当にいろいろなものを\n食べ歩いてきましたね…", 1, 6, "", 18, 105901, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (185, 0, 0, "キャル", "そうね…ほんっとうにね…\n毒まみれのニセドラゴンとか\n恐竜…は逃げられちゃったっけ\nあとワニゴ…ワニの魔物とかね", 2, 6, "", 26, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (186, 0, 0, "キャル", "そして、とうとう本物の\nドラゴンまで相手に\nしちゃったのよね、あたしたちって", 2, 6, "", 27, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (187, 0, 0, "キャル", "信じられない強さだったわね\nあのドラゴン…やっぱり\n作戦はしっかり立てていかないと\nダメよね", 2, 6, "", 28, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (188, 0, 0, "ペコリーヌ", "えへへ…☆\nキャルちゃんが色んなことを\n覚えていてくれて\nうれしいです♪", 0, 6, "", 19, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (189, 0, 0, "コッコロ", "わたくしも鮮明に覚えておりますよ\n主さまもきっと…♪", 1, 6, "", 19, 105901, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (190, 0, 0, "キャル", "あったり前でしょ！\n忘れないわよ、あんな滅茶苦茶な\nものばかり食べさせられて！\n…忘れられるわけ、ないじゃない", 2, 6, "", 29, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (191, 0, 0, "キャル", "ねえちょっと、ちょっと待って！？\nカリンから、2.5周年記念の\n生放送に出演してほしいって\n言われたんだけど！", 0, 7, "", 30, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (192, 0, 0, "キャル", "なんでそういう大事なことを\n急に言うわけ！？\nそんなの聞いてないわよ～！？", 0, 7, "", 31, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (193, 0, 0, "キャル", "いっぱい人に見られちゃうのよね？\nなんであたしがそんなこと…", 0, 7, "", 32, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (194, 0, 0, "キャル", "あー\nあー\n…声、これで大丈夫かしら？", 0, 7, "", 33, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (195, 0, 0, "キャル", "聞き取りにくいかもしれないわね…\nもうちょっと明るい方がいいかも\nえっと…こんな感じ？", 0, 7, "", 34, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (196, 0, 0, "キャル", "オイッスー☆", 0, 7, "", 35, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (197, 0, 0, "キャル", "……\nいや、ないわ\nいつもどおりが一番ね、うん", 0, 7, "", 36, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (198, 0, 0, "キャル", "もう、記念の生放送なんて\n超責任重大なやつじゃない…\nもしなにか失敗とかしたら…", 0, 7, "", 37, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (199, 0, 0, "キャル", "ど、どど、どうしよう！？\n緊張してきちゃった…！！", 0, 7, "", 38, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (200, 0, 0, "コッコロ", "主さま、わたくし\nペコリーヌさまとキャルさまと共に\n2.5周年を祝う生放送に\n出演する大役を仰せつかりました", 0, 8, "", 20, 105901, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (201, 0, 0, "コッコロ", "多くの方々に\n『プリンセスコネクト！\nRe:Dive』の魅力をお伝えする\n重要な役割でございます", 0, 8, "", 21, 105901, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (202, 0, 0, "コッコロ", "わたくし、全身全霊をもって\n生放送に取り組みたいと\n思っております", 0, 8, "", 22, 105901, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (203, 0, 0, "コッコロ", "ですが、もしかしたら\nセリフを噛んでしまったり\n段取りを間違えてしまったり\nするかもしれません…", 0, 8, "", 23, 105901, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (204, 0, 0, "コッコロ", "そのようなことがないよう\n練習はしっかりしておかなくては\nまずはこちらから…", 0, 8, "", 24, 105901, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (205, 0, 0, "コッコロ", "オイッスー☆", 0, 8, "", 25, 105901, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (206, 0, 0, "コッコロ", "先ほどキャルさまが練習されて\nいるのをお見かけしたので\nわたくしもと思いまして…\nいかがでしょうか？", 0, 8, "", 26, 105901, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (207, 0, 0, "コッコロ", "良い感じ、ですか？\n…ふふ、ありがとうございます\n主さまのあたたかいお言葉があれば\nわたくしは百人力でございます", 0, 8, "", 27, 105901, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (208, 0, 0, "コッコロ", "この大役を無事に成し遂げ\n主さまに素敵な2.5周年を\n迎えていただけるよう…\nわたくし、尽力いたしますね", 0, 8, "", 28, 105901, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (209, 0, 0, "ペコリーヌ", "オイッスー☆", 0, 9, "", 20, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (210, 0, 0, "ペコリーヌ", "…う～ん、今のはちょっと\n違う感じがしますね\n堅苦しかったかもしれません", 0, 9, "", 21, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (211, 0, 0, "ペコリーヌ", "あと６日で2.5周年ですか…", 0, 9, "", 22, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (212, 0, 0, "ペコリーヌ", "この年月がオイッスーの\n歴史なんだと思うと\nじ～んとしちゃいます！\nやばいですね☆", 0, 9, "", 23, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (213, 0, 0, "ペコリーヌ", "生放送で最高のオイッスー☆　を\nみなさんにお届けするために\n頑張らないと！\nそれじゃあもう一度…", 0, 9, "", 24, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (214, 0, 0, "ペコリーヌ", "オイッスー☆", 0, 9, "", 25, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (215, 0, 0, "ペコリーヌ", "…うう～ん、どうしてでしょう\nまだ何かが違う気がします…\nもしかしたら\nおなかが空きすぎてるとか？", 0, 9, "", 26, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (216, 0, 0, "ペコリーヌ", "今さっき食べたばっかりですけど\nおなかが減っては\n良いオイッスー☆　は\n出せませんよね！", 0, 9, "", 27, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (217, 0, 0, "ペコリーヌ", "そうと決まれば、コッコロちゃんと\nキャルちゃんを誘って\nごはんにしましょう！\n善は急げです！", 0, 9, "", 28, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (218, 0, 0, "ペコリーヌ", "あ、二人が丁度いいところに！\nオイッス～☆　…ああ！！\n今の、今のですよ～♪", 0, 9, "", 29, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (219, 0, 0, "ペコリーヌ", "なるほど、どんな時も\n自然体が一番ってことですね！\nこの調子で、生放送も\n頑張っちゃいます♪", 0, 9, "", 30, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (220, 0, 0, "ペコリーヌ", "2.5周年まで残り５日ですが\nその前にもうすぐ生放送ですよ！\nコッコロちゃん\n準備の方はどうですか？", 0, 10, "", 31, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (221, 0, 0, "コッコロ", "はい。わたくし、しっかりと\n備えてまいりました\n万事抜かりはございません", 1, 10, "", 29, 105901, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (222, 0, 0, "ペコリーヌ", "おお～すごい自信を感じます…！\nいい生放送になりそうですね☆\n……あれ？　なんだかこの辺り\n揺れていませんか？", 0, 10, "", 32, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (223, 0, 0, "キャル", "…………", 2, 10, "", 39, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (224, 0, 0, "コッコロ", "キャルさま？\nお風邪をひかれたんでしょうか\nひどい震えですが…", 1, 10, "", 30, 105901, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (225, 0, 0, "キャル", "かかかか風邪じゃないわよ！\nここここれはただ\nななな生放送が楽しみ過ぎて\nワワワワクワクが止まらないだけ！", 2, 10, "", 40, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (226, 0, 0, "ペコリーヌ", "大丈夫ですかキャルちゃん！？\nそうだ、これを飲んでください！", 0, 10, "", 33, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (227, 0, 0, "キャル", "きき気がきくじゃない、ありがとっ\nごくっ、んく…ぶはぁっ！？\nちょっと何飲ませたの！？\n辛っ！　苦ぁ！？　甘ぁっ！？", 2, 10, "", 41, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (228, 0, 0, "ペコリーヌ", "これは魔物のエキスに薬草に\nその他色んなものを混ぜた\n特製の栄養ドリンクです！", 0, 10, "", 34, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (229, 0, 0, "ペコリーヌ", "これを飲めば体ぽかぽかで\n元気いっぱいですよ♪", 0, 10, "", 35, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (230, 0, 0, "キャル", "このアホリーヌ！\n風邪じゃないって言ったでしょ！？\nどさくさに紛れて\nそんな恐ろしいもん飲ませんな～！", 2, 10, "", 42, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (231, 0, 0, "コッコロ", "キャルさま\n震えが収まっておりますね\nよかったです…\nわたくし、心配いたしました", 1, 10, "", 31, 105901, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (232, 0, 0, "キャル", "え？　ああ、ホントね…って\nだから風邪じゃないって\n言ってるのに…\nまあいいわこの際なんでも", 2, 10, "", 43, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (233, 0, 0, "ペコリーヌ", "えっへへ～♪　いつも通りの\nキャルちゃんに戻りましたし\n素敵な生放送が出来そうですね！\n今から楽しみです☆", 0, 10, "", 36, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (234, 0, 0, "カリン", "ランドソルのみなさま、こんにちは\n生放送の会場設営を担当しています\n【ギルド管理協会】のカリンです", 0, 11, "", 6, 190801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (235, 0, 0, "カリン", "【美食殿】のみなさんは\nまもなく始まる生放送に向けて\n最後の調整のため\n席を外しています", 0, 11, "", 7, 190801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (236, 0, 0, "カリン", "頑張っている３人の\n邪魔をするわけには\nいきませんので、ご容赦ください", 0, 11, "", 8, 190801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (237, 0, 0, "カリン", "ですので、本日は私から\n【美食殿】のみなさんの様子を\nお伝えさせていただこうと思います", 0, 11, "", 9, 190801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (238, 0, 0, "カリン", "まずはペコリーヌさんですが…\n何やら大量のおにぎりを\n食べているようです\nえっと…栄養は大事ですよね", 0, 11, "", 10, 190801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (239, 0, 0, "カリン", "次にコッコロさんですが\nこちらは発声練習をしています", 0, 11, "", 11, 190801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (240, 0, 0, "カリン", "一生懸命、小さなお口を開けて\n声を出す姿が応援したくなりますね", 0, 11, "", 12, 190801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (241, 0, 0, "カリン", "そしてキャルさんは…\nこれは…堂々としたものですね\n何もせず、ただ立ち尽くして…", 0, 11, "", 13, 190801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (242, 0, 0, "カリン", "あれ？\nもしかして緊張で気を失って…？", 0, 11, "", 14, 190801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (243, 0, 0, "カリン", "…ええと\n【美食殿】のみなさんは\nやる気十分なようですね！", 0, 11, "", 15, 190801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (244, 0, 0, "カリン", "３人とも生放送を\nいいものにしようと\n全力で頑張ってくれていますので\nどうかご期待ください", 0, 11, "", 16, 190801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (245, 0, 0, "カリン", "それでは\nまた明日お会いしましょう♪", 0, 11, "", 17, 190801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (246, 0, 0, "キャル", "2.5周年まであと３日！\nそして生放送は明日！\nなんかいよいよって感じね…", 0, 12, "", 44, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (247, 0, 0, "ペコリーヌ", "３人でい～っぱい練習しましたし\nきっと大丈夫ですよ☆", 2, 12, "", 37, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (248, 0, 0, "コッコロ", "ペコリーヌさまに\n大丈夫と言ってもらえると\nとても心強いですね", 1, 12, "", 32, 105901, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (249, 0, 0, "キャル", "信じすぎちゃだめよコロ助\nこいつはなーんにも\n考えてないだけなんだから", 0, 12, "", 45, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (250, 0, 0, "ペコリーヌ", "ひどいですよぉキャルちゃ～ん！", 2, 12, "", 38, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (251, 0, 0, "コッコロ", "ふふ。お二人とも\n普段通りの様子で\n安心いたしました", 1, 12, "", 33, 105901, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (252, 0, 0, "ペコリーヌ", "はいっ☆\n生放送でもなんでも\n全力全開、わたしらしく\nぶつかっていくだけです！", 2, 12, "", 39, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (253, 0, 0, "キャル", "そうね。おめでたいことなんだし\nここまで来たんなら\n楽しめるだけ\n楽しむしかないわよね！", 0, 12, "", 46, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (254, 0, 0, "コッコロ", "わたくしも、普段よりも心が\n熱くなっております\nこの胸の気持ちをお伝えできるよう\n精一杯努力いたします…！", 1, 12, "", 34, 105901, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (255, 0, 0, "ペコリーヌ", "それでは、いきましょう！\n明日の生放送、絶対に\n成功させましょうね☆", 2, 12, "", 40, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (256, 0, 0, "ペコリーヌ", "えっと、最初のひと言は…あれ？\nキャルちゃん、わたし\n何て言うんでしたっけ？", 0, 13, "", 41, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (257, 0, 0, "キャル", "は！？\nなにいきなりど忘れしてるの！？\nっていうかあんた、台本は！？", 2, 13, "", 47, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (258, 0, 0, "ペコリーヌ", "忘れてきちゃいました☆", 0, 13, "", 42, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (259, 0, 0, "キャル", "忘れてきちゃいました☆\nで済ませられると思ってんの！？\nほら、あたし二冊持ってきたから\nこれ使いなさい！", 2, 13, "", 48, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (260, 0, 0, "コッコロ", "マイクとは、こんな高い位置に\nあるものなのですね…！\n背伸びをすれば、何とか…\nう～ん、うぅ～ん…！", 1, 13, "", 35, 105901, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (261, 0, 0, "キャル", "あぁもう\n少し下げればいいでしょ！？\nこれくらいでいい？\nまったく、世話が焼けるわね…", 2, 13, "", 49, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (262, 0, 0, "ペコリーヌ", "あれ？\nキャルちゃん、後ろ髪が\nはねちゃってますよ？", 0, 13, "", 43, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (263, 0, 0, "キャル", "え？　うそっ！？\nちゃんと確かめてきたのに！\nどこどこ！？", 2, 13, "", 50, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (264, 0, 0, "コッコロ", "キャルさま、動かないで\nくださいまし。今くしで…\nはい、直りましたよ", 1, 13, "", 36, 105901, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (265, 0, 0, "キャル", "あ、ありがと…はぁ。生放送\n本番までもうすぐなのに\nこんなことしてる場合じゃ\nないわよね", 2, 13, "", 51, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (266, 0, 0, "コッコロ", "はい、時間は残りわずかです\nですが、慌ただしく\n動き回るこの時間も\nなんだか楽しくて…♪", 1, 13, "", 37, 105901, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (267, 0, 0, "キャル", "コロ助、あんた…って\nそうじゃなくて！\n胸にジンワリきてる\n暇なんかないでしょ…！？", 2, 13, "", 52, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (268, 0, 0, "ペコリーヌ", "あはは♪\nキャルちゃんの動きが\nとっても面白いです♪\nやばいですね☆", 0, 13, "", 44, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (269, 0, 0, "コッコロ", "ふふ\nきっと面白い生放送になると\nわたくし、確信しております", 1, 13, "", 38, 105901, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (270, 0, 0, "ペコリーヌ", "絶対絶対、間違いありません！\n見てくれるみなさんが\n笑顔になれる時間を\nお届けしましょう！", 0, 13, "", 45, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (271, 0, 0, "キャル", "そんなの当然でしょ！\n誰が見たって面白いって\n言ってもらえるように\nあれだけ準備したんだから！", 2, 13, "", 53, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (272, 0, 0, "ペコリーヌ", "それでは\n記念日直前生放送！\n楽しみにしててくださいね☆", 0, 13, "", 46, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (273, 0, 0, "カリン", "こんにちは\n【ギルド管理協会】のカリンです", 0, 14, "", 18, 190801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (274, 0, 0, "カリン", "昨日の生放送は\nいかがだったでしょうか？", 0, 14, "", 19, 190801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (275, 0, 0, "カリン", "たくさんの笑顔と喜びと\nそして驚きを受け取って\nいただけたのではないかと思います", 0, 14, "", 20, 190801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (276, 0, 0, "カリン", "そしていよいよ\n明日は2.5周年の当日\n待ちに待った記念日を\n迎えることとなります", 0, 14, "", 21, 190801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (277, 0, 0, "カリン", "【美食殿】のみなさんも\n張り切って様々な準備を\nされていますよ", 0, 14, "", 22, 190801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (278, 0, 0, "カリン", "【ギルド管理協会】も\n万全のサポート体制で\n協力してまいりたいと思います", 0, 14, "", 23, 190801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (279, 0, 0, "カリン", "…ふふ、本当に楽しみですね\n【ギルド管理協会】の職員として\nだけではなく、私個人としても…", 0, 14, "", 24, 190801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (280, 0, 0, "カリン", "この記念日を迎えられることが\n心から楽しみですし\n幸せを感じています", 0, 14, "", 25, 190801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (281, 0, 0, "カリン", "きっと【美食殿】のみなさんは\nそれ以上に心を弾ませて\nいることでしょう", 0, 14, "", 26, 190801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (282, 0, 0, "カリン", "それでは\n明日からの2.5周年を\nどうぞ、お楽しみに…♪", 0, 14, "", 27, 190801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (283, 0, 0, "ペコリーヌ", "準備はいいですかっ？\n…いっきますよー！", 0, 15, "", 47, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (284, 0, 0, "キャル", "祝！", 2, 15, "", 54, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (285, 0, 0, "コッコロ", "2.5周年！", 1, 15, "", 39, 105901, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (286, 0, 0, "ペコリーヌ", "おめでとうございま～す☆", 0, 15, "", 48, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (287, 0, 0, "キャル", "少し前まではまだまだ先じゃない\nとか言ってたけど\n本当にあっという間だったわね", 2, 15, "", 55, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (288, 0, 0, "コッコロ", "光陰矢の如し…\nとはこのことでございますね\nでも、今日という日を無事に\n迎えることができて良かったです", 1, 15, "", 40, 105901, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (289, 0, 0, "ペコリーヌ", "コッコロちゃん！　キャルちゃん！\n落ち着くには\nまだ早いですよ！\n盛り上がるのはこれからです☆", 0, 15, "", 49, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (290, 0, 0, "キャル", "ほんとあんたはいつも\n全力全開ねー\nでもそうね、記念日なんだし\nパーっといきましょ！", 2, 15, "", 56, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (291, 0, 0, "コッコロ", "ええ、わたくしも全力全開で\nまいります…！\n主さま、さあ\nどうぞ手を取ってくださいまし…♪", 1, 15, "", 41, 105901, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (292, 0, 0, "キャル", "あんたもコロ助も、浮かれて\n転ぶんじゃないわよ？\n…仕方ないから、あたしも\n手を繋いであげるわよ", 2, 15, "", 57, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (293, 0, 0, "ペコリーヌ", "あー！　二人ともずるいです！\nわたしもっ、ギュー♪", 0, 15, "", 50, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (294, 0, 0, "キャル", "ちょっ、ペコリーヌ！\nくっつき過ぎよ！", 2, 15, "", 58, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (295, 0, 0, "ペコリーヌ", "記念日だから\n平気平気♪\nやばいですね☆", 0, 15, "", 51, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (296, 0, 0, "キャル", "意味分かんないわよ！", 2, 15, "", 59, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (297, 0, 0, "コッコロ", "ふふ。このめでたき日に\n喜びがあふれておりますね\n主さまは…いかがでしょうか？", 1, 15, "", 42, 105901, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (298, 0, 0, "コッコロ", "喜んでいただけているならば\nわたくしはとてもとても\n幸せでございます", 1, 15, "", 43, 105901, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (299, 0, 0, "ペコリーヌ", "さぁ、2.5周年を\n楽しみ尽くしますよ☆\nまだまだ食べたいものもありますし\nやりたいこともたくさんです！", 0, 15, "", 52, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (300, 0, 0, "キャル", "分かった、分かったから\n引っ張るんじゃないわよ！\n…そんな掴まなくても\nちゃんとついていくから", 2, 15, "", 60, 106001, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (301, 0, 0, "コッコロ", "ペコリーヌさま…キャルさま…\n主さま…共にまいりましょう\nどこまでも…！", 1, 15, "", 44, 105901, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (302, 0, 0, "ペコリーヌ", "はい！　それでは2.5周年\n食べつくしツアーへ！\nそして、その先の未来へ\n向かって出発しましょう！", 0, 15, "", 53, 105801, 80003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (303, 0, 0, "ペコリーヌ・コッコロ・キャル", "2.5周年\nありがとうございます！", 0, 15, "105901,45,106001,61", 54, 105801, 80003, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (304, 0, 1, "カリン", "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1, 0, "", 1, 190804, 60002, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (305, 1, 1, "", "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 2, 0, "", 0, 0, 60002, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (306, 1, 1, "", "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 2, 0, "", 0, 0, 60002, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (307, 1, 1, "", "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 2, 0, "", 0, 0, 60002, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (308, 1, 1, "", "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 2, 0, "", 0, 0, 60002, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (309, 1, 2, "", "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 2, 0, "", 0, 0, 60002, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (310, 2, 1, "", "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 2, 0, "", 0, 0, 60002, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (311, 2, 1, "", "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 2, 0, "", 0, 0, 60002, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (312, 2, 1, "", "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 2, 0, "", 0, 0, 60002, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (313, 2, 1, "", "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 2, 0, "", 0, 0, 60002, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (314, 2, 2, "", "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 2, 0, "", 0, 0, 60002, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (315, 3, 1, "", "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 2, 0, "", 0, 0, 60002, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (316, 3, 1, "", "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 2, 0, "", 0, 0, 60002, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (317, 3, 1, "", "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 2, 0, "", 0, 0, 60002, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (318, 3, 1, "", "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 2, 0, "", 0, 0, 60002, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (319, 3, 1, "", "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたい焼き！　和菓子パワーで売上アップです！", 2, 0, "", 0, 0, 60002, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (320, 3, 1, "", "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 2, 0, "", 0, 0, 60002, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (321, 3, 2, "", "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかのごとく、色々な事がうまくいきますよ♪", 2, 0, "", 0, 0, 60002, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (322, 4, 1, "", "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 2, 0, "", 0, 0, 60002, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (323, 4, 1, "", "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 2, 0, "", 0, 0, 60002, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (324, 4, 1, "", "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 2, 0, "", 0, 0, 60002, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (325, 4, 1, "", "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 2, 0, "", 0, 0, 60002, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (326, 4, 1, "", "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 2, 0, "", 0, 0, 60002, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (327, 4, 1, "", "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 2, 0, "", 0, 0, 60002, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (328, 4, 2, "", "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 2, 0, "", 0, 0, 60002, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (329, 0, 0, "カリン", "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 3, 0, "", 2, 190804, 60002, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (330, 0, 0, "カリン", "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 3, 7, "", 3, 190804, 60002, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (331, 0, 0, "コッコロ", "ささ、シェフィさまはこちらへ…", 4, 1, "", 1, 105901, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (332, 0, 0, "シェフィ", "コッコロさん、どこへ行くの…？\n…え？", 0, 1, "", 1, 106401, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (333, 0, 0, "ペコリーヌ", "『おめでとうございます！\nわ～パチパチー！』\n…という感じでどうですかね！？", 3, 1, "", 1, 105801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (334, 0, 0, "コッコロ", "ではわたくしも\n後ろからクラッカーを鳴らして\n応戦いたします\nああ、当日が待ち遠しいですね", 4, 1, "", 2, 105901, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (335, 0, 0, "シェフィ", "ええと…\n二人とも何をしているの？", 0, 1, "", 2, 106401, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (336, 0, 0, "キャル", "シェフィは初めてだもんね\nあの日が近いからって\n予行練習してんのよ\n気が早いわよね～", 1, 1, "", 1, 106001, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (337, 0, 0, "シェフィ", "あの日…？", 0, 1, "", 3, 106401, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (338, 0, 0, "ペコリーヌ", "その通りです…\nいよいよ記念すべきあの日が\n近づいてきましたよ！", 3, 1, "", 2, 105801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (339, 0, 0, "ペコリーヌ", "『プリンセスコネクト！\nRe:Dive』3.5周年！", 3, 1, "", 3, 105801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (340, 0, 0, "カリン", "やばいですね☆", 2, 1, "", 1, 190801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (341, 0, 0, "キャル", "って、なにしれっと\n参加してんのよカリン！", 1, 1, "", 2, 106001, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (342, 0, 0, "カリン", "ふふ、いいじゃないですか\n【ギルド管理協会】として\n私もみなさんと一緒に\nお祝いをさせてください！", 2, 1, "", 2, 190801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (343, 0, 0, "カリン", "それに…記念日が近づけば\nとっておきの情報を\nお届けしますから♪", 2, 1, "", 3, 190801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (344, 0, 0, "ペコリーヌ", "というわけで\n今日からシェフィちゃんも一緒に\nカウントダウンしちゃいましょう！\n3.5周年まで…", 3, 1, "", 4, 105801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (345, 0, 0, "シェフィ", "えっ！？　ええとええと…！\nあ、あと14日…！", 0, 1, "", 4, 106401, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (346, 0, 0, "ペコリーヌ", "3.5周年まであと13日\n豪華に、そして盛大に\nお祝いしたいですね☆", 3, 2, "", 5, 105801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (347, 0, 0, "コッコロ", "豪華といえば前にとある貴族さまが\n舞踏会を開かれたそうで\n主さまがそのお手伝いを\nしておりました", 1, 2, "", 3, 105901, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (348, 0, 0, "コッコロ", "そこで美しい所作を学ばれたので\nわたくしも教えていただきました\nしゃなり、しゃなり…\nいかがでしょう？", 1, 2, "", 4, 105901, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (349, 0, 0, "ペコリーヌ", "すっごく上手ですよ☆\nまるでお姫様みたいです\nせっかくなのでわたしも\nしゃなりしゃなり", 3, 2, "", 6, 105801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (350, 0, 0, "コッコロ", "さすがでございます\nペコリーヌさま", 1, 2, "", 5, 105901, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (351, 0, 0, "キャル", "いや、あんたは\nできなきゃダメでしょ\n本物のお姫様なんだし", 0, 2, "", 3, 106001, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (352, 0, 0, "シェフィ", "しゃなり、しゃなり…\nふふ、案外できるものね", 2, 2, "", 5, 106401, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (353, 0, 0, "ペコリーヌ", "わぁ！\nシェフィちゃん\n姿勢がとってもキレイです♪", 3, 2, "", 7, 105801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (354, 0, 0, "コッコロ", "さ、次はキャルさまの\n番でございますよ", 1, 2, "", 6, 105901, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (355, 0, 0, "キャル", "あ、あたしはいいわよ！\nそういうの全然分かんないし…", 0, 2, "", 4, 106001, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (356, 0, 0, "シェフィ", "大丈夫\nやってみると結構楽しいわよ\nほらほらっ", 2, 2, "", 6, 106401, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (357, 0, 0, "キャル", "そ、そこまで言うなら…\nしゃなにゅわきゃあっ！", 0, 2, "", 5, 106001, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (358, 0, 0, "キャル", "いたたた…もぉお～！\nなんであたしがこんな目に～！", 0, 2, "", 6, 106001, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (359, 0, 0, "コッコロ", "まぁまぁ\n記念日までに練習すれば\nできるようになるかもしれません\nよろしければお教えいたしますよ", 1, 2, "", 7, 105901, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (360, 0, 0, "キャル", "よし！\nあんたたちができて\nあたしだけできないのはしゃくだし\nやってやろうじゃないの！！", 0, 2, "", 7, 106001, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (361, 0, 0, "コッコロ", "3.5周年まであと12日\n記念日当日はもちろんですが\nその日を待つ時間というのも\n心躍ります", 1, 3, "", 8, 105901, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (362, 0, 0, "ペコリーヌ", "分かりますっ！\nどんな特別な料理を食べられるのか\n考えるだけでワクワクしますよね！", 3, 3, "", 8, 105801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (363, 0, 0, "コッコロ", "特別な料理といえば、お祭りですね\nそういえば主さまは学生として\n聖学祭に参加されたこと\nがあるとか…", 1, 3, "", 9, 105901, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (364, 0, 0, "シェフィ", "聖学祭…って、なにかしら？", 2, 3, "", 7, 106401, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (365, 0, 0, "コッコロ", "聖テレサ女学院の祭典ですよ\n二つのチームが競い合い\n青春を満喫するのが趣旨のようです", 1, 3, "", 10, 105901, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (366, 0, 0, "キャル", "それってカルミナの\nサプライズライブがあった\nお祭りよね？\nちょっと見たかったかも…", 0, 3, "", 8, 106001, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (367, 0, 0, "キャル", "カルミナの後の\nライブも好評だったらしいじゃない\n確か、なかよし部\nだったっけ…？", 0, 3, "", 9, 106001, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (368, 0, 0, "ペコリーヌ", "なかよし部…\n仲が良さそうな名前で\nやばいですね☆", 3, 3, "", 9, 105801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (369, 0, 0, "キャル", "いや、そのまんますぎでしょ…", 0, 3, "", 10, 106001, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (370, 0, 0, "シェフィ", "聖学祭かぁ…なんだか楽しそうね\nそれになかよし部の人たちも\n気になるわ", 2, 3, "", 8, 106401, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (371, 0, 0, "ペコリーヌ", "それじゃあわたしたちも、\n負けじと仲良くしましょう♪\nほらほらシェフィちゃん、\nぎゅーっ☆　ですよ♪", 3, 3, "", 10, 105801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (372, 0, 0, "シェフィ", "えっ？　ええ…\nぎゅーっ…？", 2, 3, "", 9, 106401, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (373, 0, 0, "キャル", "3.5周年まであと11日！？\nお祝いの準備進んでないんだけど…\nああ～昨日に戻りたいわ…", 0, 4, "", 11, 106001, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (374, 0, 0, "シェフィ", "そういえばそんな魔道具があるって\n聞いたことがあるわね\n確か、名前はタイムラーベ…", 2, 4, "", 10, 106401, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (375, 0, 0, "キャル", "なにそれヤバいわね\nでも本当にあるんだったら\n準備よりももっとやり直したいこと\nたくさんあるんだけど…", 0, 4, "", 12, 106001, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (376, 0, 0, "コッコロ", "もしや正月の件でしょうか…？\nあの時はお金がなくて\n苦労しましたから", 1, 4, "", 11, 105901, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (377, 0, 0, "キャル", "あれはそうね…\nお金を湯水のように使う\nぺコリーヌを止められたら\nあんな苦労をすることもなかったし", 0, 4, "", 13, 106001, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (378, 0, 0, "ペコリーヌ", "そんなこともありましたね！\nやり直したいといえば\n『きゃるきゃる～ん♪』\nの方かと思いましたよ！", 3, 4, "", 11, 105801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (379, 0, 0, "キャル", "バラすんじゃないわよ\nこのアホリーヌ！\nシェフィはそれ\n知らないんだから！", 0, 4, "", 14, 106001, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (380, 0, 0, "キャル", "こうなったらもう、なんとか\nタイムラーべを探し出して\n今の会話をなかったことに…\nって、どうしたのよシェフィ", 0, 4, "", 15, 106001, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (381, 0, 0, "シェフィ", "うん…もし、私だったら…\n私が知らないみんなとの時間を\n見てみたいな、って…", 2, 4, "", 11, 106401, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (382, 0, 0, "ペコリーヌ", "シェフィちゃん！　タイムなんとか\nなんかなくても大丈夫ですよ！\n一緒の時間はこれから\nどんどん作ればいいんですから！", 3, 4, "", 12, 105801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (383, 0, 0, "コッコロ", "はい、今この瞬間も\n未来にはかけがえのない思い出に\nなっていることでしょう", 1, 4, "", 12, 105901, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (384, 0, 0, "キャル", "だからそんな顔しないの\nほら、お祝いの準備、進めるわよ！", 0, 4, "", 16, 106001, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (385, 0, 0, "シェフィ", "みんな…そうね\n最高のお祝いにして\n最高の思い出にしましょう！", 2, 4, "", 12, 106401, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (386, 0, 0, "ペコリーヌ", "3.5周年まで、あと10日！\nもうすぐですよー！\n楽しみすぎて、やばいですね！", 3, 5, "", 13, 105801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (387, 0, 0, "ペコリーヌ", "そういえば…たくさんのおもちゃが\n子どもたちを襲うっていう\n騒動もありましたね…\nなんでも勝手に動き出したとか！", 3, 5, "", 14, 105801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (388, 0, 0, "ペコリーヌ", "学校や孤児院とかに\nちっちゃなおもちゃが乗り込んで\n暴れたみたいですよ！", 3, 5, "", 15, 105801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (389, 0, 0, "キャル", "暴れたって言っても\n所詮はおもちゃじゃない\nどうせちっさいんでしょ？", 0, 5, "", 17, 106001, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (390, 0, 0, "キャル", "だったら魔法で\n全部ぶっ飛ばせばいいじゃない！\n大したことないわよ！", 0, 5, "", 18, 106001, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (391, 0, 0, "シェフィ", "キャルってば…\n相手は子どもが\n大事にしてる物なのよ…？", 2, 5, "", 13, 106401, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (392, 0, 0, "コッコロ", "乱暴な発言は\nめっ、でございますよ？\n子どもの教育に悪影響を\n与えてしまいますから…", 1, 5, "", 13, 105901, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (393, 0, 0, "ペコリーヌ", "キャルちゃんだって\n意外と猫グッズとか\nたっくさん集めてますよね？\nもしその子たちが暴れたら…？", 3, 5, "", 16, 105801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (394, 0, 0, "キャル", "う、うっさいわね！\n意外とか言うな！\n…ま、まあ確かに正面切って\n魔法でぶっ飛ばせないかもね…", 0, 5, "", 19, 106001, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (395, 0, 0, "ペコリーヌ", "あはは☆\nキャルちゃんのそういうところ\n好きですよ♪", 3, 5, "", 17, 105801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (396, 0, 0, "ペコリーヌ", "そんなキャルちゃんに猫グッズを\nプレゼントしちゃいますね！\n一部で流行っていた、たい焼き屋の\nおまけフィギュアですよ♪", 3, 5, "", 18, 105801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (397, 0, 0, "ペコリーヌ", "乱暴に扱ったりしないでくださいね\nひとりでに暴れ出しちゃうかも\nしれませんから！", 3, 5, "", 19, 105801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (398, 0, 0, "カリン", "3.5周年まであと９日\nここでみなさんに\nビックニュースですよ！", 2, 6, "", 4, 190801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (399, 0, 0, "カリン", "3.5周年を祝う生放送に\n去年と同様【美食殿】の\nみなさんにご出演いただくことが\n決定しましたー！", 2, 6, "", 5, 190801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (400, 0, 0, "キャル", "…えっ！？", 1, 6, "", 20, 106001, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (401, 0, 0, "ペコリーヌ", "本当ですか！？\nそれじゃ今から張り切って\n生放送中に食べる魔物料理を\n作らなくちゃですね☆", 3, 6, "", 20, 105801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (402, 0, 0, "シェフィ", "いや…がんばるところは\nそこじゃないような…\nというか去年も出演してたのね\nすごいじゃない！", 0, 6, "", 14, 106401, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (403, 0, 0, "コッコロ", "はい。とても緊張しますが\nやりがいのある大役です\n一緒にがんばりましょうね\nシェフィさま", 4, 6, "", 14, 105901, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (404, 0, 0, "シェフィ", "わ、私も出るの！？　でも…\n私も【美食殿】の一人だものね\nそれなら今からしっかり準備をして\nコンディションを整えないと…", 0, 6, "", 15, 106401, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (405, 0, 0, "キャル", "ふふん♪\n生放送直前のカチコチになった\nシェフィの姿が楽しみだわ！", 1, 6, "", 21, 106001, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (406, 0, 0, "ペコリーヌ", "去年のキャルちゃんは\n緊張しすぎてずっと震えて\nかわいかったですもんね！\n今年もあの姿が見たいです！", 3, 6, "", 21, 105801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (407, 0, 0, "キャル", "ぶっ殺すぞ！？", 1, 6, "", 22, 106001, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (408, 0, 0, "カリン", "というわけで\n『プリンセスコネクト！\nRe:Dive』の魅力を\nお伝えする生放送をお楽しみに♪", 2, 6, "", 6, 190801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (409, 0, 0, "コッコロ", "3.5周年まであと８日\nでございますよ\n楽しみですね、主さま", 1, 7, "", 15, 105901, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (410, 0, 0, "キャル", "そういえばあんた\n夏休みの宿題は\nきちんとやってるの？", 0, 7, "", 23, 106001, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (411, 0, 0, "シェフィ", "宿題…学校に通うのも\n楽しいことばかりじゃ\nないのね", 2, 7, "", 16, 106401, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (412, 0, 0, "ペコリーヌ", "あれ？　そういえば\n少し前にルーセント学院で\n何かあったような…", 3, 7, "", 22, 105801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (413, 0, 0, "キャル", "ああ、始業式の日に\n大捕り物があったって\n話題になってたわね", 0, 7, "", 24, 106001, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (414, 0, 0, "シェフィ", "夏休みを終わらせないって\n騒いでたっていう話？\nあれ本当なの？\n都市伝説だと思ってたわ", 2, 7, "", 17, 106401, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (415, 0, 0, "コッコロ", "その一件ならよく存じ上げて\nおります。ですから主さま\n次の機会にはわたくしと一緒に\nがんばりましょう", 1, 7, "", 16, 105901, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (416, 0, 0, "シェフィ", "楽しそう…私も一緒にやりたいな\nママ…じゃ、じゃなくて！\nコッコロさん、私もまざっていい？", 2, 7, "", 18, 106401, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (417, 0, 0, "コッコロ", "もちろんでございます\n仲良くお勉強いたしましょう", 1, 7, "", 17, 105901, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (418, 0, 0, "キャル", "しれっと教育ママが\n生まれてる…？", 0, 7, "", 25, 106001, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (419, 0, 0, "ペコリーヌ", "お勉強は大切ですよ！\nキャルちゃんも一緒に\nがんばりましょう！", 3, 7, "", 23, 105801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (420, 0, 0, "キャル", "え～～～～！？", 0, 7, "", 26, 106001, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (421, 0, 0, "キャル", "3.5周年まであと７日〜♪\nふふ～ん♪\nふんふふ～ん♪", 0, 8, "", 27, 106001, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (422, 0, 0, "シェフィ", "…\nねぇコッコロさん\nキャル、どうしちゃったの？", 2, 8, "", 19, 106401, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (423, 0, 0, "コッコロ", "とてもご機嫌そうに\n鼻歌を歌ってらっしゃいますね\n耳も尻尾もリズミカルに\n揺れて…ノリノリでございます", 1, 8, "", 18, 105901, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (424, 0, 0, "ペコリーヌ", "あれはですね！\nカルミナのみなさんの\nサマーライブのチケットが\n手に入ったからなんですよ♪", 3, 8, "", 24, 105801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (425, 0, 0, "シェフィ", "ええっ！？\nあのライブのチケットって確か\n入手困難だったんじゃ…", 2, 8, "", 20, 106401, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (426, 0, 0, "キャル", "ふふふふ～ん♪\nしゃいにんぐふゅ～ちゃ～♪", 0, 8, "", 28, 106001, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (427, 0, 0, "コッコロ", "なるほど…\nキャルさまがあのように\nなってしまうのも頷けますね", 1, 8, "", 19, 105901, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (428, 0, 0, "シェフィ", "…カルミナの\n『Shining Future』\nの中に、シャイニングフューチャー\nって歌詞はなかったはずだけど…", 2, 8, "", 21, 106401, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (429, 0, 0, "キャル", "ふんふ…はっ！？\nあっ、あんたたち！\nなに人の鼻歌を\n勝手に聞いてるのよ！？", 0, 8, "", 29, 106001, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (430, 0, 0, "キャル", "こっ、これは別に\nカルミナの曲じゃなくて…\nあたしのオリジナルソングよ！\n聞いたらお金取るわよっ！？", 0, 8, "", 30, 106001, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (431, 0, 0, "ペコリーヌ", "えへへ、キャルちゃん\nカルミナのサマーライブ\n思いっきり楽しみましょうね☆", 3, 8, "", 25, 105801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (432, 0, 0, "キャル", "も～っ！\n生暖かい目で見るな～～！\nぶっ殺すわよ～～～！", 0, 8, "", 31, 106001, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (433, 0, 0, "シェフィ", "3.5周年まであと６日\n３人も言ってたけど\nあっという間だったわね", 0, 9, "", 22, 106401, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (434, 0, 0, "シェフィ", "…えっ？\n生放送の意気込み！？\n突然なに！？", 0, 9, "", 23, 106401, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (435, 0, 0, "シェフィ", "ええと…\nとにかく失敗しないように\n台本たくさん読んで…\nそれから…", 0, 9, "", 24, 106401, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (436, 0, 0, "シェフィ", "えっ！？\nトラブルがあったら\nどうするのかって！？\nそ、それは…！", 0, 9, "", 25, 106401, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (437, 0, 0, "シェフィ", "とにかく落ち着いて\nスタッフさんの指示を聞いて…", 0, 9, "", 26, 106401, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (438, 0, 0, "シェフィ", "それから、それから…！\nぅ、ぅぅっ…！", 0, 9, "", 27, 106401, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (439, 0, 0, "シェフィ", "―びえぇぇ～んっ！！！", 0, 9, "", 28, 106401, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (440, 0, 0, "コッコロ", "どうされましたか、シェフィさま", 1, 9, "", 20, 105901, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (441, 0, 0, "シェフィ", "ううっ…ひっく…\nママッ…！", 0, 9, "", 29, 106401, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (442, 0, 0, "コッコロ", "よしよし、緊張されてるのですね\nママが傍におりますよ\n主さま、少々お待ちくださいませ", 1, 9, "", 21, 105901, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (443, 0, 0, "コッコロ", "…ふぅ\nシェフィさま\n生放送への意気込み\nお話しできそうですか？", 1, 9, "", 22, 105901, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (444, 0, 0, "シェフィ", "…ううっ\n恥ずかしすぎて\nもう生放送出られない…", 0, 9, "", 30, 106401, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (445, 0, 0, "コッコロ", "主さま\n3.5周年まであと５日\nでございます", 0, 10, "", 23, 105901, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (446, 0, 0, "コッコロ", "ですがその前に\n生放送がありますね", 0, 10, "", 24, 105901, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (447, 0, 0, "コッコロ", "…生放送に向けた\n意気込みでございますか？", 0, 10, "", 25, 105901, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (448, 0, 0, "コッコロ", "もちろんわたくしは\n主さまのために\n全身全霊を込めて\n楽しい時間をご提供いたします", 0, 10, "", 26, 105901, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (449, 0, 0, "コッコロ", "…と、意気込んでみましたが\nうまくできるか少し不安です\n声が小さくなったり\n間違えてしまったらどうしようと…", 0, 10, "", 27, 105901, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (450, 0, 0, "コッコロ", "ですがわたくしは\n一人ではありません\n【美食殿】のみなさまが\nおります", 0, 10, "", 28, 105901, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (451, 0, 0, "コッコロ", "どんな困難も\nみなさまと一緒なら\n乗り越えられると\nわたくし、確信しております", 0, 10, "", 29, 105901, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (452, 0, 0, "コッコロ", "それに今回はシェフィさまも\nご参加されるわけですし\nママとしてお手本に\nならねばなりませんね", 0, 10, "", 30, 105901, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (453, 0, 0, "コッコロ", "主さま。3.5周年も\n食卓を囲んでいる時のような\n楽しい思い出を\n一緒に作りましょうね", 0, 10, "", 31, 105901, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (454, 0, 0, "ペコリーヌ", "3.5周年まであと４日！\nやばいですね☆", 0, 11, "", 26, 105801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (455, 0, 0, "キャル", "はいはい、やばいわね\nというかもうすぐ生放送だけど\nあんた準備はできてるの？", 1, 11, "", 32, 106001, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (456, 0, 0, "ペコリーヌ", "ばっちりオイッスー☆　ですよ！\n『王家の装備』も全開です！", 0, 11, "", 27, 105801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (457, 0, 0, "ペコリーヌ", "あとは前回を超える\n最高のオイッスー☆　を\nお届けできるように\n練習あるのみですかね！", 0, 11, "", 28, 105801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (458, 0, 0, "ペコリーヌ", "キャルちゃんは\nどうなんですか？\nオイッスー☆　を\n毎日ちゃんと練習してますか？", 0, 11, "", 29, 105801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (459, 0, 0, "キャル", "はぁ！？　なんであたしまで\nその変なあいさつを練習しないと\nいけないのよ！", 1, 11, "", 33, 106001, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (460, 0, 0, "ペコリーヌ", "もしかしてやってないんですか？\nダメですよキャルちゃん！\nシェフィちゃんだってちゃんと\n毎日練習してるのに！", 0, 11, "", 30, 105801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (461, 0, 0, "ペコリーヌ", "こうなったらわたしがキャルちゃん\nにオイッスー☆　の『オ』から\nしっかり教えてあげないと！", 0, 11, "", 31, 105801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (462, 0, 0, "ペコリーヌ", "オイッスー☆　の『オ』は\n口を大きく開いて〜\nドラゴンの骨つき肉に\nかぶりつく直前をイメージして〜", 0, 11, "", 32, 105801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (463, 0, 0, "キャル", "だからあたしはやるなんて一言も…", 1, 11, "", 34, 106001, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (464, 0, 0, "ペコリーヌ", "オイッスー☆", 0, 11, "", 33, 105801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (465, 0, 0, "キャル", "聞きなさいっての！！", 1, 11, "", 35, 106001, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (466, 0, 0, "シェフィ", "3.5周年まであと３日…\nそして生放送は、明日…", 2, 12, "", 31, 106401, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (467, 0, 0, "シェフィ", "もっと台本を\n読み込んでおかないと…\nあと発声練習も…", 2, 12, "", 32, 106401, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (468, 0, 0, "シェフィ", "おいっす！\n…こうじゃなかったわね\nええと確か…", 2, 12, "", 33, 106401, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (469, 0, 0, "シェフィ", "うう…あんなに練習したのに\nこれじゃみんなに迷惑かけちゃう…", 2, 12, "", 34, 106401, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (470, 0, 0, "シェフィ", "【美食殿】の一員として\n認められるように\n頑張らないといけないのに\nよし、もう一度…", 2, 12, "", 35, 106401, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (471, 0, 0, "ペコリーヌ", "やってますねシェフィちゃん！", 3, 12, "", 34, 105801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (472, 0, 0, "キャル", "なによ、考えることは\nみんな同じってこと？", 0, 12, "", 36, 106001, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (473, 0, 0, "コッコロ", "ふふ。シェフィさま\nよろしければ\n仲間に入れてください\n一緒にやればきっとうまくできます", 1, 12, "", 32, 105901, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (474, 0, 0, "シェフィ", "みんな…もちろんよ！", 2, 12, "", 36, 106401, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (475, 0, 0, "ペコリーヌ", "それじゃ明日の生放送に向けて\n一緒に練習がんばりましょう☆", 3, 12, "", 35, 105801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (476, 0, 0, "カリン", "3.5周年まであと２日と\n迫った本日は…\nいよいよ生放送です！", 2, 13, "", 7, 190801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (477, 0, 0, "カリン", "【美食殿】のみなさんが\n準備に入られていますので\nそれぞれ繋いでみましょう！\nまずはペコリーヌさんです！", 2, 13, "", 8, 190801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (478, 0, 0, "ペコリーヌ", "今日もオイッスー☆\nみんなで一緒に\nオイッスー☆", 3, 13, "", 36, 105801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (479, 0, 0, "カリン", "お手本になるような\n発声練習ですね！\nそれでは続いてコッコロさん", 2, 13, "", 9, 190801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (480, 0, 0, "コッコロ", "はじめちょろちょろ\nなかぱっぱ～♪\n生放送前にみなさまで\n食卓を囲んで英気を養いましょう", 4, 13, "", 33, 105901, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (481, 0, 0, "カリン", "さすが【美食殿】のママですね！\nそしてキャルさんは…", 2, 13, "", 10, 190801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (482, 0, 0, "キャル", "大丈夫…大丈夫…\nあたしは大丈夫…", 1, 13, "", 37, 106001, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (483, 0, 0, "カリン", "す、すごく震えてますけど\n大丈夫でしょうか…？\nそして今回初参加となる\n期待の新人シェフィさん！", 2, 13, "", 11, 190801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (484, 0, 0, "シェフィ", "あうー？", 0, 13, "", 37, 106401, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (485, 0, 0, "みんな", "あ…", 4, 13, "105901,34,106001,38,190801,12", 37, 105801, 80005, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (486, 0, 0, "キャル", "ちょ、ちょっとシェフィ！？\nなに赤ちゃん返りしてん―\nあ痛ぁっ！\n噛んだわこいつーっ！", 1, 13, "", 39, 106001, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (487, 0, 0, "コッコロ", "シェフィさま\n緊張しすぎて\nしまったのでしょうね…\nおーよしよし…", 4, 13, "", 35, 105901, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (488, 0, 0, "ペコリーヌ", "シェフィちゃん！\nそういう時は手のひらに\n好きな文字を書いて\n食べちゃうといいですよ！", 3, 13, "", 38, 105801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (489, 0, 0, "カリン", "…ええと、現場からは以上です！\n生放送はもうすぐ！\n特別なお知らせもありますので\nどうぞお楽しみに！", 2, 13, "", 13, 190801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (490, 0, 0, "シェフィ", "3.5周年の記念日も\nいよいよ明日ね\n…って、あれ？", 2, 14, "", 38, 106401, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (491, 0, 0, "ペコリーヌ", "記念日はこの森へ行きませんか！？\nすっごく美味しいお肉が\nとれるんです☆", 3, 14, "", 39, 105801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (492, 0, 0, "キャル", "うげ、またあの魔物？\nさすがに今度は\n丸焼きとかはやめてよね…\n見た目がヤバすぎるし", 0, 14, "", 40, 106001, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (493, 0, 0, "コッコロ", "ふふ、キャルさまもだいぶ\n魔物肉に慣れてきたようですね\n調理ならばわたくしに\nお任せください♪", 1, 14, "", 36, 105901, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (494, 0, 0, "シェフィ", "みんな、何をしているの？\nなんだか、\n不穏な単語が聞こえたんだけど…", 2, 14, "", 39, 106401, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (495, 0, 0, "ペコリーヌ", "シェフィちゃん！\n明日の食べ尽くしツアーの\n相談をしてたんですよ！", 3, 14, "", 40, 105801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (496, 0, 0, "コッコロ", "はい。明日は【美食殿】の\n一員となったシェフィさまと一緒に\n初めて記念日を過ごすのですから\n特別なコース料理を用意しませんと", 1, 14, "", 37, 105901, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (497, 0, 0, "キャル", "ふふん♪\n猫の毛も逆立つような\nあれこれを食べさせられるから\n覚悟しておいたほうがいいわよ？", 0, 14, "", 41, 106001, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (498, 0, 0, "シェフィ", "へ、へぇ…", 2, 14, "", 40, 106401, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (499, 0, 0, "ペコリーヌ", "期待しててくださいね！\nシェフィちゃんとあなたに\n『おいちー！』って喜んでもらえる\n最高のごちそうを準備しますから☆", 3, 14, "", 41, 105801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (500, 0, 0, "シェフィ", "ええと…その…うーんと…\nわ、分かったわ\n私も【美食殿】の一員だもの", 2, 14, "", 41, 106401, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (501, 0, 0, "シェフィ", "それにあなたも一緒みたいだし\n最後までがんばってみるわ…！", 2, 14, "", 42, 106401, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (502, 0, 0, "ペコリーヌ", "それではいつものあれを\nやりましょう！\n準備はいいですかっ？\n…いっきますよー！", 3, 15, "", 42, 105801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (503, 0, 0, "キャル", "祝！", 1, 15, "", 42, 106001, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (504, 0, 0, "コッコロ", "3.5周年！", 4, 15, "", 38, 105901, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (505, 0, 0, "シェフィ", "おめでとうございます！", 0, 15, "", 43, 106401, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (506, 0, 0, "カリン", "この日を迎えられたのも\nあなたが『プリンセスコネクト！\nRe:Dive』を遊んでくれている\nおかげです！", 2, 15, "", 14, 190801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (507, 0, 0, "カリン", "ということで\nみなさんからあなたへ一言ずつ\n感謝の言葉をどうぞ！", 2, 15, "", 15, 190801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (508, 0, 0, "ペコリーヌ", "感謝の言葉ですか？　わたしは\n毎日あなたに感謝してますよ\n【美食殿】の仲間になってくれて…\n一緒にごはんを食べてくれて…", 3, 15, "", 43, 105801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (509, 0, 0, "ペコリーヌ", "なにより今でもわたしをぺコリーヌ\nって呼んでくれてありがとうござい\nます。これからもわたしはあなたの\nぺコリーヌです！　やばいですね☆", 3, 15, "", 44, 105801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (510, 0, 0, "キャル", "えっ！？　今度はあたし！？\n感謝って…まぁ、そうね…\nあんたにはあたしが\n辛くて苦しい時に助けてもらって…", 1, 15, "", 43, 106001, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (511, 0, 0, "キャル", "でもおかげで色々吹っ切れたわ！\nもしあんたが困ってたら今度は\nあたしが助けてあげるから\nその時はちゃんと言いなさいよ！", 1, 15, "", 44, 106001, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (512, 0, 0, "シェフィ", "ええと…次は私ね\n実はよく覚えてないのだけど\n空から落ちてきた私を受け止めて\nくれたのはあなたなのでしょう？", 0, 15, "", 44, 106401, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (513, 0, 0, "シェフィ", "最初に私を見つけてくれたのが\nあなたで良かったって思ってるの\nおかげで私は居場所を見つけたから\nあなたがくれたもの、大切にするわ", 0, 15, "", 45, 106401, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (514, 0, 0, "コッコロ", "では最後にわたくしから…\nわたくしは主さまの元を離れた日…\nこのように記念日をお祝いする\nことは二度とないと思っていました", 4, 15, "", 39, 105901, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (515, 0, 0, "コッコロ", "ですが、主さまはわたくしを\n迎えにきてくださり、今もこうして\nおそばにおいてくださっています\nわたくしにとって毎日が記念日です", 4, 15, "", 40, 105901, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (516, 0, 0, "コッコロ", "わたくしたちの物語は\nまだ続いていきます\nこれからも一緒にページを\n作っていきましょうね", 4, 15, "", 41, 105901, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (517, 0, 0, "ペコリーヌ", "それじゃ\nいつものあれでしめますよ！\nみんなで一緒に、さんはい☆", 3, 15, "", 45, 105801, 80005, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (518, 0, 0, "みんな", "これからも\nよろしくおねがいします！", 4, 15, "105901,42,106001,45,106401,46,190801,16", 46, 105801, 80005, 1);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (519, 0, 1, "カリン", "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1, 0, "", 1, 190804, 60003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (520, 1, 1, "", "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 2, 0, "", 0, 0, 60003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (521, 1, 1, "", "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 2, 0, "", 0, 0, 60003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (522, 1, 1, "", "今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", 2, 0, "", 0, 0, 60003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (523, 1, 1, "", "今日の運勢は姫吉！　精霊も新年の幸福をお祝いしています！　　主さまの笑顔が見られて、わたくしも幸せいっぱいでございます♪", 2, 0, "", 0, 0, 60003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (524, 1, 2, "", "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 2, 0, "", 0, 0, 60003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (525, 2, 1, "", "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 2, 0, "", 0, 0, 60003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (526, 2, 1, "", "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 2, 0, "", 0, 0, 60003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (527, 2, 1, "", "今日の運勢は大吉！　ラッキーカラーは鮮やかな黄色！　　　　　さらにシマシマのアイテムを持つと、運気倍増らしいッスよ♪", 2, 0, "", 0, 0, 60003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (528, 2, 1, "", "今日の運勢は大吉！　秘められた力が開花するでしょう！　　　　じゃあ、私の龍眼と力比べしてみようか？　ふふ、冗談だよ～", 2, 0, "", 0, 0, 60003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (529, 2, 2, "", "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 2, 0, "", 0, 0, 60003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (530, 3, 1, "", "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 2, 0, "", 0, 0, 60003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (531, 3, 1, "", "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 2, 0, "", 0, 0, 60003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (532, 3, 1, "", "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 2, 0, "", 0, 0, 60003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (533, 3, 1, "", "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 2, 0, "", 0, 0, 60003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (534, 3, 1, "", "今日の運勢は中吉！　ラッキーアイテムはかわいいもの！　　　　ア、アタシはかわいいじゃなくてキレイだってば！　も～っ！", 2, 0, "", 0, 0, 60003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (535, 3, 1, "", "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 2, 0, "", 0, 0, 60003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (536, 3, 2, "", "今日の運勢は中吉！　悩まず行動すれば強運に恵まれる！　　　　守るよりも攻めるが吉だ！　勝負事をするにはいい運勢だな！", 2, 0, "", 0, 0, 60003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (537, 4, 1, "", "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 2, 0, "", 0, 0, 60003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (538, 4, 1, "", "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 2, 0, "", 0, 0, 60003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (539, 4, 1, "", "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 2, 0, "", 0, 0, 60003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (540, 4, 1, "", "今日の運勢は小吉！　難しい頼み事をされるかもしれません！　　うまくやれればきっと成長につながります、挑戦してみましょう！", 2, 0, "", 0, 0, 60003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (541, 4, 1, "", "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 2, 0, "", 0, 0, 60003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (542, 4, 1, "", "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 2, 0, "", 0, 0, 60003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (543, 4, 2, "", "今日の運勢は小吉！　無理は禁物、お家で静かにしていましょう　プロぼっちの私が、お家での過ごし方……教えてあげましょうか？", 2, 0, "", 0, 0, 60003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (544, 0, 0, "カリン", "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 3, 0, "", 2, 190804, 60003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (545, 0, 0, "カリン", "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 3, 7, "", 3, 190804, 60003, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (546, 0, 1, "カリン", "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1, 0, "", 1, 190804, 60004, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (547, 1, 1, "", "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 2, 0, "", 0, 0, 60004, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (548, 1, 1, "", "今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", 2, 0, "", 0, 0, 60004, 0);
INSERT INTO `v1_8d315da1f41da15ab5768ec99230e923726c852670cf000ce16cd691183635fc` VALUES (549, 1, 1, "", "今日の運勢は姫吉！　宴でも開きたくなるほどの絶対幸運！\nイメチェンでもしてみるのはどうだ？　ぴょんぴょん、なんてな♪", 2, 0, "", 0, 0, 60004, 0);
